    const myStyle={
        backgroundImage:`url("http://localhost:3000/Imgs/bg.png")`,
                height:'100vh',
                marginTop:'-70px',
                fontSize:'50px',
                backgroundSize: 'cover',
                backgroundRepeat: 'no-repeat',
                };
    return ( 
        <>
        <div  className="bg">
            <NavBar></NavBar>
            <Banner></Banner>
            <MiddleLayer></MiddleLayer>
            <Footer></Footer>
            </div>
        </>
     );
}

export default MainPage;
